function Header() {

    setTimeout(() => {
        let date = new Date()
    }, 1000);

    return <div className="header">
        <div className=""><p>{date.getFullYear()} - {date.getMonth()} - {date.getDay()}</p>
        <p>{date.getHours()} : {date.getMinutes()} : {date.getSeconds()}</p>
        </div>
        <div className="">2</div>
    </div>
}

export default Header
